import React from "react";

const AdminDashboard = () => {
  return (
    <div className="page" style={{ textAlign: "center" }}>
      <h1>Admin Dashboard</h1>
      <p>Only admins can see this.</p>
    </div>
  );
};

export default AdminDashboard;
